import React from "react";
import "./style.css";


function Home() {
  return (
    <React.Fragment>
     <header>
        <h1>MY WORK</h1>
        <h5>A few projects I have worked on</h5>
      </header>
    </React.Fragment>
  );
}

export default Home;
